import React, { useState } from 'react';
import AirportDropdown from './components/AirportDropdown';
import RouteForm from './components/RouteForm';
import Map from './components/Map';
import ResultTable from './components/ResultTable';

function App() {
    const [start, setStart] = useState(''); // Starting airport code
    const [end, setEnd] = useState(''); // Destination airport code
    const [routeResults, setRouteResults] = useState(null); // Route results from backend

    // Log updates for state changes
    console.log('Starting Airport:', start);
    console.log('Destination Airport:', end);
    console.log('Route Results:', routeResults);

    return (
        <div className="container">
            <h1>Shortest Flight Path</h1>
            <div className="form-section">
                {/* Log which dropdown is rendering */}
                {console.log('Rendering AirportDropdown for Starting Airport')}
                <AirportDropdown label="Starting Airport" onSelect={(value) => {
                    console.log('Selected Starting Airport:', value);
                    setStart(value);
                }} />
                
                {console.log('Rendering AirportDropdown for Destination Airport')}
                <AirportDropdown label="Destination Airport" onSelect={(value) => {
                    console.log('Selected Destination Airport:', value);
                    setEnd(value);
                }} />

                {/* Log form submission */}
                {console.log('Rendering RouteForm')}
                <RouteForm
                    start={start}
                    end={end}
                    onResults={(results) => {
                        console.log('Received Results from RouteForm:', results);
                        setRouteResults(results);
                    }}
                />
            </div>

            {/* Conditionally render ResultTable and log */}
            {console.log('Rendering ResultTable with Route Results:', routeResults)}
            {routeResults && <ResultTable results={routeResults} />}

            {/* Conditionally render Map and log */}
            {console.log('Rendering Map with Route Path:', routeResults?.path)}
            <Map route={routeResults?.path} />
        </div>
    );
}

export default App;
